input = ""

#input = "dabAcCaCBAcCcaDA"

def react(input, i):
  next_letter = int(i)
  for letter in input:
    try:
      if letter.islower():
        if input[next_letter] == letter.upper():
          input = input[:next_letter-1] + input[next_letter+1:]
          return(input)

      else:
        if input[next_letter] == letter.lower():
          input = input[:next_letter-1] + input[next_letter+1:]
          return(input)
    except IndexError:
      return(1)

    next_letter += 1

flag = 1
while(flag):
  input = react(input, 1)
  flag = isinstance(react(input, 1), basestring)

print(len(input))
